import React, { useEffect, useState } from 'react';
import { getData } from '../api/endpoint';

const MedecinDossiers = () => {
  const [dossiers, setDossiers] = useState([]);

  useEffect(() => {
    const fetchDossiers = async () => {
      try {
        const data = await getData('/dossiers');
        setDossiers(data);
      } catch (e) {
        console.error(e);
      }
    };

    fetchDossiers();
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2>ðŸ©º Dossiers des patients</h2>

      {dossiers.map((d) => (
        <div key={d.id} style={{
          border: '1px solid #ccc',
          padding: '12px',
          marginBottom: '10px'
        }}>
          <p><strong>Patient :</strong> {d.patientName}</p>
          <p><strong>Motif :</strong> {d.motif}</p>
          <p><strong>Diagnostic :</strong> {d.diagnostic || 'â€”'}</p>
        </div>
      ))}
    </div>
  );
};

export default MedecinDossiers;
